import React from 'react';

const SkillTree = () => {
  const skills = [
    { name: 'Project Management', icon: 'üéØ', level: 'Level 80', unlocked: true, master: false, position: 'left' },
    { name: 'Augmented Reality', icon: 'üîÆ', level: 'Level 95 (MASTER)', unlocked: true, master: true, position: 'right' },
    { name: 'Design Patterns', icon: 'üèóÔ∏è', level: 'Level 85', unlocked: true, master: false, position: 'right' },
    { name: 'Virtual Reality', icon: 'ü•Ω', level: 'Level 90 (MASTER)', unlocked: true, master: true, position: 'left' },
    { name: 'Multiplayer', icon: 'üåê', level: 'Level 88', unlocked: true, master: false, position: 'right' },
    { name: 'Unity', icon: 'üéÆ', level: 'Level 95 (MASTER)', unlocked: true, master: true, position: 'right' },
    { name: 'Game Design', icon: 'üé®', level: 'Level 85', unlocked: true, master: false, position: 'left' }
  ];

  return (
    <section id="skills" className="game-section">
      <div className="skill-tree">
        <h2 className="section-title">Skill Tree</h2>

        <div className="skills-container">
          {/* Left Cluster */}
          <div className="skill-cluster left-cluster">
            {skills.filter(skill => skill.position === 'left').map((skill, index) => (
              <div 
                key={skill.name}
                className={`skill-bubble ${skill.unlocked ? 'unlocked' : ''} ${skill.master ? 'master' : ''}`}
                style={{ 
                  animationDelay: `${index * 0.2}s`,
                  top: `${index * 120 + 50}px`
                }}
              >
                <div className="bubble-content">
                  <div className="skill-icon">{skill.icon}</div>
                  <div className="skill-name">{skill.name}</div>
                  <div className="skill-level">{skill.level}</div>
                </div>
                <div className="bubble-glow"></div>
              </div>
            ))}
          </div>

          {/* Right Cluster */}
          <div className="skill-cluster right-cluster">
            {skills.filter(skill => skill.position === 'right').map((skill, index) => (
              <div 
                key={skill.name}
                className={`skill-bubble ${skill.unlocked ? 'unlocked' : ''} ${skill.master ? 'master' : ''}`}
                style={{ 
                  animationDelay: `${index * 0.2}s`,
                  top: `${index * 100 + 30}px`
                }}
              >
                <div className="bubble-content">
                  <div className="skill-icon">{skill.icon}</div>
                  <div className="skill-name">{skill.name}</div>
                  <div className="skill-level">{skill.level}</div>
                </div>
                <div className="bubble-glow"></div>
              </div>
            ))}
          </div>

          {/* Connecting Lines */}
          <svg className="connection-lines" width="100%" height="100%">
            <defs>
              <linearGradient id="lineGradient" x1="0%" y1="0%" x2="100%" y2="0%">
                <stop offset="0%" style={{ stopColor: 'rgba(65, 105, 225, 0.3)', stopOpacity: 1 }} />
                <stop offset="100%" style={{ stopColor: 'rgba(255, 215, 0, 0.3)', stopOpacity: 1 }} />
              </linearGradient>
            </defs>
            {/* Add connecting lines between nearby bubbles */}
            <line x1="30%" y1="150" x2="70%" y2="130" stroke="url(#lineGradient)" strokeWidth="2" opacity="0.3" />
            <line x1="35%" y1="270" x2="65%" y2="230" stroke="url(#lineGradient)" strokeWidth="2" opacity="0.3" />
            <line x1="40%" y1="390" x2="60%" y2="330" stroke="url(#lineGradient)" strokeWidth="2" opacity="0.3" />
          </svg>

          {/* Floating Particles */}
          <div className="floating-particles">
            {[...Array(20)].map((_, i) => (
              <div 
                key={i} 
                className="particle"
                style={{ 
                  animationDelay: `${i * 0.3}s`,
                  left: `${Math.random() * 100}%`,
                  top: `${Math.random() * 100}%`
                }}
              ></div>
            ))}
          </div>
        </div>
      </div>
    </section>
  );
};

export default SkillTree;
